import React, { Component } from 'react';
import './App.css';
import Todo from './Todo';
import NewTodo from './NewTodo';


class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      todos: [
        {
          "id": "123",
          "text": "test text",
          "user": "user 1233",
          "completed": false,
          "created_at": "2020-10-14 18:02:29",
          "updated_at": "2020-10-14 18:02:31",
        }
      ],
    }
  }

  handleSubmit = event => {
    event.preventDefault();
    const input = event.target.elements.inputtext;
    const text = input.value;
    const self = this;
    const apiKey = '7cfc00-0dc6d4-b0f90b-4d1861-9b39aa';
    if (text !== '') {
      const todo_obj = {
        text: text,
        completed: false,
        created: Date.now(),
      }
      var xhttp2 = new XMLHttpRequest();
      xhttp2.onreadystatechange = function () {
        if (this.readyState === 4 && this.status === 200) {
          self.tempfunction();
        }
      };
      xhttp2.open("POST", "https://cse204.work/todos", true);
      xhttp2.setRequestHeader("Content-type", "application/json");
      xhttp2.setRequestHeader("x-api-key", apiKey);
      xhttp2.send(JSON.stringify(todo_obj));
      input.value = "";
    }
  };

  sortItems = () => {
    const stateDupe = [...this.state.todos];
    stateDupe.sort((a, b) => a.text.localeCompare(b.text));
    this.setState({ todos: stateDupe });
  }

  tempfunction = () => {
    const self = this;
    const apiKey = '7cfc00-0dc6d4-b0f90b-4d1861-9b39aa';
    var xhttp = new XMLHttpRequest();
    xhttp.onreadystatechange = function () {
      if (this.readyState === 4 && this.status === 200) {
        self.setState({ todos: JSON.parse(this.responseText) });
        //console.log('new run');
        //console.log(self.state.todos);
      }
    };
    xhttp.open("GET", "https://cse204.work/todos", true);
    xhttp.setRequestHeader("x-api-key", apiKey);
    xhttp.send();
  }

  checkEvent(todo) {
    const thisStore = this;
    const apiKey = '7cfc00-0dc6d4-b0f90b-4d1861-9b39aa';
    var xhttp2 = new XMLHttpRequest();
    xhttp2.onreadystatechange = function () {
      if (this.readyState === 4 && this.status === 200) {
        let items = [...thisStore.state.todos];
        let tempindex = items.indexOf(element => element.id = todo.id)
        let item = { ...items[tempindex] };
        item = JSON.parse(this.responseText);
        items[tempindex] = item;
        thisStore.setState(items);
      }
    };
    xhttp2.open("PUT", "https://cse204.work/todos/" + todo.id, true);
    xhttp2.setRequestHeader("Content-type", "application/json");
    xhttp2.setRequestHeader("x-api-key", apiKey);
    todo.completed = !todo.completed;
    xhttp2.send(JSON.stringify(todo));
  }

  deleteEvent(todo) {
    let self = this;
    const apiKey = '7cfc00-0dc6d4-b0f90b-4d1861-9b39aa';
    var xhttp2 = new XMLHttpRequest();
    xhttp2.onreadystatechange = function () {
      if (this.readyState === 4 && this.status === 200) {
        self.tempfunction();
      }
    };
    xhttp2.open("DELETE", "https://cse204.work/todos/" + todo.id, true);
    xhttp2.setRequestHeader("Content-type", "application/json");
    xhttp2.setRequestHeader("x-api-key", apiKey);
    xhttp2.send();
  }

  componentDidMount = () => {
    const self = this;
    const apiKey = '7cfc00-0dc6d4-b0f90b-4d1861-9b39aa';
    var xhttp = new XMLHttpRequest();
    xhttp.onreadystatechange = function () {
      if (this.readyState === 4 && this.status === 200) {
        self.setState({ todos: JSON.parse(this.responseText) });
        self.sortItems();
      }
    };
    xhttp.open("GET", "https://cse204.work/todos", true);
    xhttp.setRequestHeader("x-api-key", apiKey);
    xhttp.send();
  }

  render() {
    return (
      <div className="big-container">
        <div className="container">
          <h1 className="todo-header"> todo list</h1>

          <NewTodo onSubmit={this.handleSubmit} onClick={this.handleSubmit} />

          <ul className="todo-ul" id="todo-ul">
            {this.state.todos.map((todo) =>
              <Todo
                text={todo.text}
                key={todo.id}
                id={todo.id}
                completed={todo.completed}
                checkEvent={() => this.checkEvent(todo)}
                deleteEvent={() => this.deleteEvent(todo)} />
            )}
          </ul>
          <div className='sort-container'>
            <button
              className="sort-btn"
              id="sort-btn"
              autofocus type="button"
              value="sort items alphabetically"
              onClick={this.sortItems}
            > sort items alphabetically
            </button>
          </div>
        </div>
      </div>
    );
  }

}

export default App;
